import React from "react";
import Grid from "@material-ui/core/Grid";
import EventCard from "./eventCard";

import { Event } from "../classes";

class DayView extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return this.props.events.map(event => {
            event = new Event(event, event.isEmpty);
            return (
                <Grid container spacing={1} key={event.title}>
                    <Grid item xs={2} key={event.startTime}>
                        <p style={{ color: "white", fontSize: 8 }}>{event.isEmpty ? "" : event.getStartTimeSrting()}</p>
                    </Grid>
                    <Grid item xs={10} key={"EventCard of " + event.title}>
                        <EventCard event={event} />
                    </Grid>
                </Grid>
            );
        });
    }
}

export default DayView;
